import React, { useState, useEffect } from 'react';

const GetRest = () => {
    const [posts, setPosts] = useState([]);
    console.log('hello');
    useEffect(() => {
        fetch('http://192.168.1.26:8050/api/records/')
            .then((response) => response.json())
            .then((data) => {
                console.log(data);
                setPosts(data);
            })
            .catch((err) => {
                console.log(err.message);
            });
    }, []);

    return (
        <div className="hi">{posts}</div>)
}

export default GetRest;
